  \"2016-04-02T16:32:52.517558\",\n\t\"name\": \"national-land-cover-data-20064f010\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NLCD 2006 quantifies land cover and land
  cover change between the years 2001 to 2006 and provides an updated version of NLCD
  2001. These products represent the first time this type of 30-meter cell land cover
  change has been produced for the conterminous United States. Products were generated
  by comparing spectral characteristics of Landsat imagery between 2001 and 2006,
  on an individual path/row basis, using protocols to identify and label change based
  on the trajectory from NLCD 2001 products. A formal accuracy assessment of the NLCD
  2006 land cover change product is planned for 2011.\",\n\t\"license_title\": null,\n\t\"extras\":
